Приложение открывает новые возможности для наших клиентов:
– все инструкции к самокатам у вас в телефоне;
– подробные краткие видеоинструкции;
– описание возможных ошибок;
– множество полезной информации;
– онлайн-консультирование;
– все контакты под рукой.
